pub enum DndEvent<'a> {
    Enter {
        offer: Option<&'a DataOffer>,
        serial: u32,
        surface: wl_surface::WlSurface,
        x: f64,
        y: f64,
    },
    Motion {
        offer: Option<&'a DataOffer>,
        time: u32,
        x: f64,
        y: f64,
    },
    Leave,
    Drop {
        offer: Option<&'a DataOffer>,
    },
}

pub enum DataSourceEvent {
    Send {
        mime_type: String,
        pipe: WritePipe,
    },
    Target {
        mime_type: Option<String>,
    },
    Action {
        action: wl_data_device_manager::DndAction,
    },
    Cancelled,
    Dropped,
    Finished,
}

pub enum PrimarySelectionSourceEvent {
    Send {
        mime_type: String,
        pipe: WritePipe,
    },
    Cancelled,
}

pub enum RepeatKind {
    Fixed {
        rate: u32,
        delay: u32,
    },
    System,
}

pub enum Error {
    XKBNotFound,
    BadNames,
    NoKeyboard,
    TimerError(std::io::Error),
}

pub enum Event<'a> {
    Enter {
        serial: u32,
        surface: wl_surface::WlSurface,
        rawkeys: &'a [u32],
        keysyms: &'a [u32],
    },
    Leave {
        serial: u32,
        surface: wl_surface::WlSurface,
    },
    Modifiers {
        modifiers: ModifiersState,
    },
    Key {
        serial: u32,
        time: u32,
        rawkey: u32,
        keysym: u32,
        state: KeyState,
        utf8: Option<String>,
    },
    Repeat {
        time: u32,
        rawkey: u32,
        keysym: u32,
        utf8: Option<String>,
    },
}

pub enum ThemeSpec<'a> {
    Precise {
        name: &'a str,
        size: u32,
    },
    System,
}

pub enum Event {
    Configure {
        new_size: Option<(u32, u32)>,
        states: Vec<State>,
    },
    Close,
}

pub enum Event {
